import React from 'react';
import Todo from './Todo';

const TodoList = ({todoList, setTodoList}) => {
  return (
    todoList.map((todo, idx) => {
      return (
        <Todo
          todo={todo}
          key={idx}
          idx={idx}
          todoList={todoList}
          setTodoList={setTodoList}
        />
      )
    })
  )
}
export default TodoList
